@sudeep a while back, we removed `instabase-api-args` from API docs with GitHub issue 92 (https://github.com/instabase/instabase-docs/issues/92) and updated the API docs (along with editorial structure in IBG-64 (https://instabase.atlassian.net/browse/IBG-64)).

To ensure our API docs are accurate and that we advise our API changes to users via docs and release notes, we're using IBG-105 (https://instabase.atlassian.net/browse/IBG-105).

@dlluncor #justfyi we're looking to verify API doc accuracy. So far,  @achao lent his wisdom to IBG-64, @Aaron Vontell chimed in on Slack convos, @sudeep first noticed API doc errors.

We need :eyes: on the API docs. All welcome to review Instabase API docs on dogfood (https://dogfood.instabase.com/docs/reference/apis/) and please use IBG-105 to advise changes. Calling all heroes.
